import React from "react";

import "../navBarFolder/cart.css"
import AddIcon from '@mui/icons-material/Add';

const ItemCount = ({stock, initial, onAdd}) =>{
    return (
        <>
        <h1>Hola {stock}. Hola {initial}. Hola {onAdd}</h1>
        <AddIcon/>
        </>
    )
}

export default ItemCount
